,'','http://www.kino-teatr.ru/movie/poster/6453.jpg',NULL),(396,NULL,NULL,NULL),(399,NULL,NULL,NULL),(400,NULL,NULL,NULL),(401,NULL,NULL,NULL),(402,NULL,NULL,NULL),(403,NULL,NULL,NULL),(404,'',NULL,NULL),(405,NULL,NULL,NULL),(406,NULL,NULL,NULL),(407,NULL,NULL,NULL),(408,NULL,NULL,NULL),(409,'',NULL,NULL),(412,'Гуманность - чтобы не только любить, но и ненавидеть...\nЗатем сентиментальность... - до известной степени...\nНу и... целомудрие...\n-------------------------------------------------------------------------\nСтранно! Очень странно! Как во сне! Подходит голый человек и говорит, что кто-то любит мою жену!\n----------------------------------------------------------------------\n - Ты нам мешаешь, Маша!\n - Что это значит: она мешает? Она сама - музыка! Сама - музыка!\n-----------------------------------------------------------------------\nВлияние высокого ума - это прекраная власть!\n-------------------------------------------------------------------------\nЧеловек - только тогда человек, когда он и радуется, и страдает.\n',NULL,NULL),(414,'',NULL,NULL),(415,'',NULL,NULL),(417,'',NULL,NULL),(418,NULL,NULL,NULL),(419,'',NULL,NULL),(420,NULL,NULL,NULL),(421,NULL,NULL,NULL),(423,NULL,NULL,NULL),(424,'',NULL,NULL),(425,'',NULL,NULL),(426,'',NULL,NULL),(427,'Никакой ты не коммунист. Партия всегда боролась с пьянством, а ты - алкоголик!\n-----------------------------------------------------------------------------\nА по Минску ты идешь: что, мало евреев?\n-----------------------------------------------------------------------------',NULL,NULL),(428,'',NULL,NULL),(429,'Детей только не рожает, старая дура. \nКажа: \"Я эмансипированная!\". Василь, что это такое? Может, болезнь какая, по женской части?\n-----------------------------------------------------------------------------\nА я думала, что ты готов! И рученьки скрестил!\n-----------------------------------------------------------------------------',NULL,NULL),(430,NULL,NULL,NULL),(431,'',NULL,NULL),(434,'',NULL,N